import React from 'react';
import AppBar from '@material-ui/core/AppBar';
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardHeader from '@material-ui/core/CardHeader';
import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import { useNavigate } from "react-router-dom";

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {'Project Computational Mathematics @'}
      <Link color="inherit" href="https://material-ui.com/">
         Wilawan Kulab 
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const useStyles = makeStyles((theme) => ({
  '@global': {
    ul: {
      margin: 0,
      padding: 0,
      listStyle: 'none',
    },
  },
  appBar: {
    borderBottom: `1px solid ${theme.palette.divider}`,
  },
  toolbar: {
    flexWrap: 'wrap',
  },
  toolbarTitle: {
    flexGrow: 1,
  },
  link: {
    margin: theme.spacing(1, 1.5),
  },
  heroContent: {
    padding: theme.spacing(8, 0, 6),
  },
  cardHeader: {
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[200] : theme.palette.grey[700],
  },
  footer: {
    borderTop: `1px solid ${theme.palette.divider}`,
    marginTop: theme.spacing(8),
    paddingTop: theme.spacing(3),
    paddingBottom: theme.spacing(3),
    [theme.breakpoints.up('sm')]: {
      paddingTop: theme.spacing(6),
      paddingBottom: theme.spacing(6),
    },
  },
}));

export default function MainPage() {
  const classes = useStyles();
  const navigate = useNavigate();

  const nextPage = (page) => {
    navigate("/WilawanCommath/"+page);
  }
  const GradientBtn = () => {
    const styles = useGradientBtnStyles();
    const chubbyStyles = useGradientBtnStyles({ chubby: true });
    const gutterStyles = usePushingGutterStyles({ cssProp: 'marginBottom', space: 2 });
  return (
    <React.Fragment>
      <CssBaseline />
      <AppBar position="static" color="default" elevation={0} className={classes.appBar}>
        <Toolbar className={classes.toolbar}>
          <Typography variant="h6" color="inherit" noWrap className={classes.toolbarTitle}>
          Computational Mathematics
          </Typography>
        </Toolbar>
      </AppBar>
      {/* Hero unit */}
      <Container maxWidth="sm" component="main" className={classes.heroContent}>
        <Typography component="h1" variant="h2" align="center" color="textPrimary" gutterBottom>
          LESSON
        </Typography>
        <Typography variant="h5" align="center" color="textSecondary" component="p">
          Select the topic you want to learn.
        </Typography>
      </Container>
      {/* End hero unit */}
      <Container maxWidth="md" component="main">
        <Grid container spacing={5} alignItems="flex-end">
            <Grid item  xs={12} sm={6} md={4}>
              <Card>
                <CardHeader
                  title="Chapter 1"
                  titleTypographyProps={{ align: 'center' }}
                  subheaderTypographyProps={{ align: 'center' }}
                  className={classes.cardHeader}
                />
                <CardContent>
                    <Typography component="h5" variant="h5" color="textPrimary" align="center">
                    Basic Computing
                    </Typography>
                </CardContent>
                <CardActions>
                  <Button classes={styles} onClick={()=>{nextPage("unit1")}}>
                    Select
                  </Button>
                </CardActions>
              </Card>
            </Grid>
            <Grid item  xs={12} sm={6} md={4}>
              <Card>
                <CardHeader
                  title="Chapter 2"
                  titleTypographyProps={{ align: 'center' }}
                  subheaderTypographyProps={{ align: 'center' }}
                  className={classes.cardHeader}
                />
                <CardContent>
                    <Typography component="h5" variant="h5" color="textPrimary" align="center" >
                    Linear Equations
                    </Typography>
                </CardContent>
                <CardActions>
                  <Button fullWidth variant="contained" color="secondary" onClick={()=>{nextPage("unit2")}}>
                  Select
                  </Button>
                </CardActions>
              </Card>
            </Grid>
            <Grid item  xs={12} sm={6} md={4}>
              <Card>
                <CardHeader
                  title="Chapter 3"
                  titleTypographyProps={{ align: 'center' }}
                  subheaderTypographyProps={{ align: 'center' }}
                  className={classes.cardHeader}
                />
                <CardContent>
                    <Typography component="h5" variant="h5" color="textPrimary" align="center">
                    Interpolation
                    </Typography>
                </CardContent>
                <CardActions>
                  <Button fullWidth variant="contained" color="secondary" onClick={()=>{nextPage("unit3")}}>
                  Select
                  </Button>
                </CardActions>
              </Card>
            </Grid>
            <Grid item  xs={12} sm={6} md={4}>
              <Card>
                <CardHeader
                  title="Chapter 4"
                  titleTypographyProps={{ align: 'center' }}
                  subheaderTypographyProps={{ align: 'center' }}
                  className={classes.cardHeader}
                />
                <CardContent>
                    <Typography component="h5" variant="h5" color="textPrimary" align="center">
                    Differentiation
                    </Typography>
                </CardContent>
                <CardActions>
                  <Button fullWidth variant="contained" color="secondary" onClick={()=>{nextPage("unit4")}}>
                  Select
                  </Button>
                </CardActions>
              </Card>
            </Grid>
            <Grid item  xs={12} sm={6} md={4}>
              <Card>
                <CardHeader
                  title="Chapter 5"
                  titleTypographyProps={{ align: 'center' }}
                  subheaderTypographyProps={{ align: 'center' }}
                  className={classes.cardHeader}
                />
                <CardContent>
                    <Typography component="h5" variant="h5" color="textPrimary" align="center">
                    Integration
                    </Typography>
                </CardContent>
                <CardActions>
                  <Button fullWidth variant="contained" color="secondary" onClick={()=>{nextPage("unit5")}}>
                  Select
                  </Button>
                </CardActions>
              </Card>
            </Grid>

            <Grid item  xs={12} sm={6} md={4}>
              <Card>
                <CardHeader
                  title="Chapter 6"
                  titleTypographyProps={{ align: 'center' }}
                  subheaderTypographyProps={{ align: 'center' }}
                  className={classes.cardHeader}
                />
                <CardContent>
                    <Typography component="h5" variant="h5" color="textPrimary" align="center" >
                    Root Finding
                    </Typography>
                </CardContent>
                <CardActions>
                  <Button fullWidth variant="contained" color="secondary" onClick={()=>{nextPage("unit6")}}>
                  Select
                  </Button>
